import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';
import Button from '../components/design-system/Button';
import Card from '../components/design-system/Card';

const PageContainer = styled.div`
  padding: 40px;
  max-width: 1200px;
  margin: 0 auto;
`;

const Hero = styled.div`
  text-align: center;
  margin-bottom: 60px;
`;

const HeroTitle = styled.h1`
  font-size: 48px;
  font-weight: 700;
  color: #111827;
  margin: 0 0 16px 0;
  line-height: 1.2;
`;

const HeroSubtitle = styled.p`
  font-size: 20px;
  color: #6b7280;
  margin: 0 0 32px 0;
  max-width: 600px;
  margin-left: auto;
  margin-right: auto;
`;

const Section = styled.section`
  margin-bottom: 60px;
`;

const SectionTitle = styled.h2`
  font-size: 32px;
  font-weight: 600;
  color: #111827;
  margin: 0 0 24px 0;
`;

const SectionDescription = styled.p`
  font-size: 16px;
  color: #6b7280;
  margin: 0 0 32px 0;
  line-height: 1.6;
`;

const CardGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  gap: 24px;
  margin-top: 32px;
`;

const ComponentCard = styled(Card)`
  cursor: pointer;
  transition: transform 0.2s ease;

  &:hover {
    transform: translateY(-4px);
  }
`;

const ComponentIcon = styled.div`
  width: 48px;
  height: 48px;
  background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
  border-radius: 12px;
  display: flex;
  align-items: center;
  justify-content: center;
  margin-bottom: 16px;
  color: white;
  font-size: 24px;
`;

const StatsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
  gap: 24px;
  margin-top: 32px;
`;

const StatCard = styled.div`
  background: #ffffff;
  padding: 24px;
  border-radius: 12px;
  border: 1px solid #e5e7eb;
  text-align: center;
`;

const StatNumber = styled.div`
  font-size: 36px;
  font-weight: 700;
  color: #2563eb;
  margin-bottom: 8px;
`;

const StatLabel = styled.div`
  font-size: 14px;
  color: #6b7280;
  font-weight: 500;
`;

const Home = () => {
  const components = [
    {
      title: 'Button',
      description: 'Interactive buttons with multiple variants, sizes, and states.',
      icon: 'üîò',
      path: '/components/button'
    },
    {
      title: 'Card',
      description: 'Content containers with various layouts and interactive states.',
      icon: 'üìÑ',
      path: '/components/card'
    },
    {
      title: 'Input',
      description: 'Form inputs with validation states and helper text.',
      icon: 'üìù',
      path: '/components/input'
    },
    {
      title: 'Modal',
      description: 'Overlay dialogs with backdrop and keyboard navigation.',
      icon: 'ü™ü',
      path: '/components/modal'
    }
  ];

  return (
    <PageContainer>
      <Hero>
        <HeroTitle>Design System</HeroTitle>
        <HeroSubtitle>
          A comprehensive collection of reusable components, guided by clear standards, 
          that can be assembled together to build any number of applications.
        </HeroSubtitle>
        <div style={{ display: 'flex', gap: '16px', justifyContent: 'center' }}>
          <Button size="large" as={Link} to="/components/button">
            Explore Components
          </Button>
          <Button variant="outline" size="large" as={Link} to="/version-control">
            View Changelog
          </Button>
        </div>
      </Hero>

      <Section>
        <SectionTitle>Core Principles</SectionTitle>
        <SectionDescription>
          Our design system is built on a foundation of consistency, accessibility, and flexibility. 
          Each component is designed to work seamlessly together while maintaining individual functionality.
        </SectionDescription>

        <CardGrid>
          <Card elevated>
            <Card.Body>
              <h3 style={{ margin: '0 0 12px 0', color: '#111827' }}>Consistency</h3>
              <p style={{ margin: 0, color: '#6b7280', lineHeight: '1.5' }}>
                Unified design language across all components ensures a cohesive user experience.
              </p>
            </Card.Body>
          </Card>

          <Card elevated>
            <Card.Body>
              <h3 style={{ margin: '0 0 12px 0', color: '#111827' }}>Accessibility</h3>
              <p style={{ margin: 0, color: '#6b7280', lineHeight: '1.5' }}>
                All components meet WCAG guidelines and support keyboard navigation.
              </p>
            </Card.Body>
          </Card>

          <Card elevated>
            <Card.Body>
              <h3 style={{ margin: '0 0 12px 0', color: '#111827' }}>Flexibility</h3>
              <p style={{ margin: 0, color: '#6b7280', lineHeight: '1.5' }}>
                Customizable components that adapt to different use cases and requirements.
              </p>
            </Card.Body>
          </Card>
        </CardGrid>
      </Section>

      <Section>
        <SectionTitle>Components</SectionTitle>
        <SectionDescription>
          Browse our collection of reusable components. Each component includes interactive examples, 
          usage guidelines, and code snippets.
        </SectionDescription>

        <CardGrid>
          {components.map((component) => (
            <ComponentCard key={component.path} hoverable as={Link} to={component.path}>
              <Card.Body>
                <ComponentIcon>{component.icon}</ComponentIcon>
                <Card.Title>{component.title}</Card.Title>
                <Card.Subtitle>{component.description}</Card.Subtitle>
              </Card.Body>
            </ComponentCard>
          ))}
        </CardGrid>
      </Section>

      <Section>
        <SectionTitle>System Stats</SectionTitle>
        <SectionDescription>
          Our design system continues to grow and evolve with your feedback and needs.
        </SectionDescription>

        <StatsGrid>
          <StatCard>
            <StatNumber>4</StatNumber>
            <StatLabel>Core Components</StatLabel>
          </StatCard>
          <StatCard>
            <StatNumber>12+</StatNumber>
            <StatLabel>Variants</StatLabel>
          </StatCard>
          <StatCard>
            <StatNumber>100%</StatNumber>
            <StatLabel>Accessible</StatLabel>
          </StatCard>
          <StatCard>
            <StatNumber>3</StatNumber>
            <StatLabel>Size Options</StatLabel>
          </StatCard>
        </StatsGrid>
      </Section>
    </PageContainer>
  );
};

export default Home;
